import React, {Component} from 'react';

class Choice extends Component{
    constructor(props){
        super(props);
        this.fname = "./static/choices/" + props.cname;
    }

    reader = new FileReader();

    answers = {
        ans1 : true,
        ans2 : true,
        ans3 : true
    }

    render(){
        return (
            <object data={this.fname} type="text/plain" width="80%"></object>
        );
    }
}
export default Choice;
